import Rating from "./Rating"
import TagList from "./TagList"
import logements from "../logements.json"


function App() {
  const CURRENT = logements[1];

  return (
  <div>
    <Rating starsNumber = {CURRENT.rating} />
    <TagList tags = {CURRENT.tags} />
  </div>)
}

export default App
